import { Route, Navigate } from 'react-router-dom';

const PrivateRoute = ({ element, isAdmin, isMerchant }) => {
  if (isAdmin) {
    return <Route element={element} />;
  } 
  else if(isMerchant) {
    return <Route element={element} />;
  }
  else{
    return <Navigate to="/access-denied" replace />;
  }
};
